is often considered one of the most lively cities in Europe. \nEdinburgh is not only one of the most beautiful cities in Europe, it is a city with a fantastic position. The view falls on all sides  green hills, the hint of the blue sea, the silhouettes of the buildings and the red cliffs. It is a city that calls you to explore it by foot  narrow streets, passageways, stairs and hidden church yards on every step will pull you away from the main streets.\nThe city is one of the most popular tourist destinations in the UK. It is the capital of Scotland and home to many tourist attractions. A visit here will be well worth it, considering the numerous things you can do and see. Most of the structures in the Old Town have remained in their original form over the years. Charming medieval relics are plenty in this section of the city. In contrast, orderly Georgian terraces line the streets of the New Town. The general urban scenery is a blend of ancient structures and modern architecture, which gives the city a unique character. In 1995, the Old Town was listed as a UNESCO Heritage Site. With year round festivals, a throbbing nightlife and an entertaining arts scene, Edinburgh never falls short of interesting travel ventures for tourists."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJUBEPBbIhMI9OK-r6iS8AIVB4eCCh2wNw9L","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJYBEP2GBCITCPTivq-okvACFQeHggodsDcPSzIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata
